const ProductModal = ({ visible, setVisible, product }) => {
  const rootClasses = [cl.modal];
  if (visible) rootClasses.push(cl.active);

  return (
    <div className={rootClasses.join(' ')}>
      <div className={cl.modalBody}>

      </div>
    </div>
  );
};

export default ProductModal;
